import React, { forwardRef } from 'react';

interface CarouselProps {
  children: React.ReactNode;
  className?: string;
}

const Root = forwardRef(({ children, className }: CarouselProps, ref) => {
  return (
    <div
      ref={ref}
      className={`flex overflow-auto snap-x snap-mandatory ${className}`}
    >
      {children}
    </div>
  );
});

export { Root };
